import React from "react";
import data from "../../json/productsData";
import Products from "./products";
import "./products.scss";
import Summary from "./summary";
import summary from "./summary";

const Main = () => {
  const { products } = data;
  console.log(products);
  return (
    <>
      <Products products={products} />
      <Summary />
    </>
  );
};

export default Main;
